import './header.css';

function Header () {
    return (
        <header className="header">
            <div className="container">
                <div calssName="header_row">
                    <div calssName="header_logo">Logo</div>
                    <div className="header_nav">Header Nav</div>
                </div>
            </div>
        </header>
    )
}

export default Header;
